TV special featuring footage filmed throughout Wings' tour 
of 1975/1976, following the band in England, Australia and 
America. It contains live concert performances featuring fifteen 
of Wings' greatest songs and home movies of Paul McCartney and 
his family, providing a fascinating profile of the McCartneys' 
life off-stage.

The tour itself was a major triumph for Wings - the first time 
the group had appeared in Australia and America, and Paul's 
first performance in the States for ten years. Three million 
people saw the shows and a then-world record attendance for an 
indoor concert of 67,053 was set at the Kingdome, Seattle.

Starting with Paul and Linda in Scotland, the special features 
the gradual build-up of the band and follows Wings on tour with 
hit songs such as Jet, Maybe I'm Amazed, Yesterday, Silly Love 
Songs and Band on the Run. The Wings line-up for the tour was 
Paul and Linda McCartney, Denny Laine, Jimmy McCulloch and 
Joe English.

